import ReactDOM from 'react-dom';


const FindFriend = () => {
    return (
        <div>
            <h2 className="text-center">Suggestions</h2>
            <div className = "row">
                <table className = "table">


                    <tbody>
                    <tr>
                            <th>Edmund</th>
                            <th><button class="editbtn">Send Request</button></th>


                    </tr>
                    <tr>
                            <th>Yash</th>
                            <th><button class="editbtn">Send Request</button></th>


                    </tr>
                    </tbody>


                </table>


            </div>
        </div>
    );
  };

export default FindFriend;
